import{_ as t,c as o,o as a,ah as d}from"./chunks/framework.PvdZnrZd.js";const h=JSON.parse('{"title":"PRODUCT FEED","description":"PRODUCT FEED","frontmatter":{"title":"PRODUCT FEED","description":"PRODUCT FEED","date":"2025-08-04T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/featured-app/marketplace-product-add-ons/product-feed.md","filePath":"zenith/featured-app/marketplace-product-add-ons/product-feed.md"}'),n={name:"zenith/featured-app/marketplace-product-add-ons/product-feed.md"};function r(l,e,i,p,s,c){return a(),o("div",null,[...e[0]||(e[0]=[d('<p>A Product Feed includes all the information related to products that are available on the marketplace for sale.</p><p><a href="/zenith/introduction/">Multivendor Marketplace</a> for Shopify has now come up with a new feature app called <strong>Product Feed</strong>.</p><p>It enables the merchants to add products in bulk from different eCommerce platforms into Shopify via XML file upload.</p><p>Using this feature app, you can add feed by uploading an XML file.</p><p>This file is having products along with their information and details such as Product ID, Product Name, Product Price, its quantity and so on.</p><p>Once you enable this feature app installed on your marketplace, $10/month gets added to your current Multivendor Plan.</p><h3 id="feature" tabindex="-1">Feature <a class="header-anchor" href="#feature" aria-label="Permalink to &quot;Feature&quot;">​</a></h3><ul><li>Admin can add Product Feed by uploading XML product file and assign it to any of his registered sellers.</li><li>This XML file is having all the data related to the products that you are selling.</li><li>All the product entities added in your XML file can be mapped with the pre-defined product entities available on your Shopify store.</li><li>Configure all related settings from his/her panel.</li><li>You can set a Price Rule on every feed that you add to your Marketplace.</li><li>Sellers registered on your marketplace can also add Feeds by adding Feed URL.</li></ul><h3 id="limitations" tabindex="-1">Limitations <a class="header-anchor" href="#limitations" aria-label="Permalink to &quot;Limitations&quot;">​</a></h3><p>There are certain limitations of this feature app listed below which you need to know.</p><ul><li>Only XML file is supported while adding products in bulk using this feature app.</li><li>You cannot update the Feed Products.</li><li>You can&#39;t add variant wise Feed Products.</li><li>Multiple images can&#39;t be uploaded for a single Feed Product.</li></ul><h3 id="installation" tabindex="-1">Installation <a class="header-anchor" href="#installation" aria-label="Permalink to &quot;Installation&quot;">​</a></h3><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/07/Dashboard-Admin.png" alt="Feature App"></p><p>To make this app work on your marketplace, first of all, you need to enable this feature from the &quot;Featured Apps&quot; section of the Multivendor app.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/10/Feature-Apps-Admin-1.png" alt="asdvbn"></p><p>Once you visit the Feature Apps section you will get this feature app. You just need to click the <strong>Enable</strong> button to activate this feature on your marketplace.</p><p>Once you click on the enable button you need to agree with the payment condition. Once you enable this feature $10 per month gets added to your current Multivendor plan.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/07/Feature-Apps-Admin-1.png" alt="Agree"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/07/Demo-Store-Approve-fees-Shopify.png" alt="Approve charge"></p><p>By clicking the agree button you can approve the charge for this feature and get this app installed. In this way, you can get this app installed on your Marketplace.</p><h3 id="product-feed-configuration" tabindex="-1">Product Feed Configuration <a class="header-anchor" href="#product-feed-configuration" aria-label="Permalink to &quot;Product Feed Configuration&quot;">​</a></h3><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/07/Feature-Apps-Admin-3.png" alt="Product Feed"></p><p>Once you enable this app, you first need to configure the feed related settings from the Configuration section of the Multivendor app.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/07/Product-Feed-Admin.png" alt="Add Feed"></p><p>Visiting this Product Feed section you need to click on the &quot;<strong>Add Product Feed</strong>&quot; button to add related details of the product Feed.</p><h2 id="add-product-feed" tabindex="-1"><strong>Add Product Feed</strong> <a class="header-anchor" href="#add-product-feed" aria-label="Permalink to &quot;**Add Product Feed**&quot;">​</a></h2><p>There, you need to mention the Feed Name, set a Price Rule for this feed and mention the Start and End node of the feed.</p><p><strong>Feed Name:-</strong> Enter the name of the product feed.</p><p><strong>Price Rule:-</strong> Set the price rule for seller&#39;s feed products, <strong>Increase</strong> (increase the original price with a certain amount),</p><p><strong>Decrease</strong> (decrease the original product price with a certain amount) and <strong>Neutral</strong> (keep the product price as it is).</p><p>Enter the <strong>Start &amp; End Node</strong>. Please refer to the screenshot for reference:-</p><p>Here:-<br> Start Node:- Product<br> End Node:- Product</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/10/Screenshot5.png" alt="sdfg"></p><p>While setting up the Price Rule of the feed you can increase, decrease the Feed Product price as well as set it to Neutral.</p><p>Change in the Product Feed Price can be set in percentage or a fixed amount.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/07/Edit-Product-Feed.png" alt="Add details"></p><p>Once you are done with all these settings, just save the details and proceed to upload an XML file. Once uploaded, you need to validate the XML file.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/07/Upload-Sample-XML.png" alt="upload Sample XML"></p><p>By clicking this <strong>Save and Upload XML</strong> you will be reaching a page where you can upload a sample XML file that contains all the necessary information about a single product.</p><p>Once it gets uploaded you can validate the file and proceed to map the entities.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/07/Upload-Sample-XML-1.png" alt="Add Mapping"></p><p>Once you validate the XML file, you can now proceed to map all the product entities available in the Product Feed  XML file with the pre-defined Shopify store product entities.</p><p>Click on the Save button to add this Product Feed.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/07/Product-Feed-Admin-1.png" alt="edit feed"></p><p>Once you add this feed, you can view this in the Add Feed section of the app. Also you can edit the Product feed details as well as delete the Feed from Action menu.</p><p>In this way admin can add Feeds on his/her end.</p><h3 id="adding-feed-products" tabindex="-1">Adding Feed Products <a class="header-anchor" href="#adding-feed-products" aria-label="Permalink to &quot;Adding Feed Products&quot;">​</a></h3><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/07/Dashboard-Admin-1.png" alt="add feed products"></p><p>Now, You can add feed Products and assign it to your registered sellers. For this, you need to enter the following details:-</p><p><strong>Seller Email:-</strong> Enter the seller&#39;s email ID for which you want to upload the product feed via the XML file.</p><p><strong>Feed Name:-</strong> Enter the name of the feed.</p><p><strong>Feed URL:-</strong> You need to mention the resource URL where the seller has added/uploaded/stored the XML file.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/07/Add-Product-By-Feed-1.png" alt="feed products"></p><p>Now, once you save the details, you will get the options to map collection in your feed to the available collection.</p><p>You can view the list of Feed products in the Product Listing Section.</p><p>Admin can edit the feed product added, he can approve the product and also deny the product by mentioning the reason.</p><p>He can deny and delete the feed product at the same time also.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/07/Product-Admin.png" alt="product detail"></p><p>In case you want to deny the product, you can simply add a reason &amp; unapprove the same.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/07/Screenshot-9-3.png" alt="deny product"></p><h3 id="seller-end" tabindex="-1">Seller End <a class="header-anchor" href="#seller-end" aria-label="Permalink to &quot;Seller End&quot;">​</a></h3><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/07/Dashboard-Seller-%E2%80%A2-Multivendor-MarketPlace.png" alt="add feed product"></p><p>Once you enable the Product Feed feature app on your marketplace, your registered sellers can also add Feed Products from the Products section of the seller panel.</p><p>Here in this section sellers can add Products in bulk using XML file by adding Feed Products. Seller just needs to enter the Feed Name and the Feed URL to add Feed Products.</p><p><strong>Feed URL:-</strong> The URL where the XML file of the products is uploaded.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/07/Add-Product-By-Feed-Seller-%E2%80%A2-Multivendor-MarketPlace.png" alt="Add feed1"></p><p>The seller can view the list of added fields in the Product Listing section of the app.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/07/Product-Seller-%E2%80%A2-Multivendor-MarketPlace.png" alt="product details"></p><p>Once the seller adds the Feed Product, he/she can view the list of Products in the Product Listing section of the Seller Panel and can anytime edit or delete the Product from the action menu.</p><p>This way you and your sellers can add Product Feeds using this feature app.</p><h3 id="demo" tabindex="-1">Demo <a class="header-anchor" href="#demo" aria-label="Permalink to &quot;Demo&quot;">​</a></h3><p>Check the Demo: <a href="https://multivendor-marketplace-5.myshopify.com/pages/seller-profile" target="_blank" rel="noreferrer">https://multivendor-marketplace-5.myshopify.com/pages/seller-profile</a> !</p>',72)])])}const g=t(n,[["render",r]]);export{h as __pageData,g as default};
